import React from 'react';
import { Card, Button } from 'react-bootstrap';

const ProjectList = ({ projects, onProjectSelect }) => {
  return (
    <div className="container py-4">
      <h4 className="mb-4">Proyectos</h4>
      {projects.map((project) => (
        <Card key={project.uid} className="border-0 shadow-sm mb-3">
          <Card.Body>
            <Card.Title className="h5">{project.name}</Card.Title>
            <Card.Text>
              Descripción: {project.settings?.description || 'Sin descripción'}
            </Card.Text>
            <Button 
              variant="primary" 
              onClick={() => onProjectSelect(project.uid)} 
              className="mt-2"
            >
              Ver encuestas
            </Button>
          </Card.Body>
        </Card>
      ))}
    </div>
  );
};

export default ProjectList;
